# caso queira verificar valores RMS das amostras e calcular potncia..., deve ter modulo numpy instalado

def vetor_total_ajustado_np(ganho, sinal):
    sinal = np.array(sinal, dtype=np.float32)  # tudo vira float32
    offset = np.mean(sinal, dtype=np.float32)  # teste de offset "automtico" ja que o toroide  "puramente" AC
    sinal = (sinal-offset)*(3.3/4096)*ganho  # primeiro desconta o offset
    return sinal


def rms_np(sinal):
    return np.sqrt(np.mean(np.square(np.abs(sinal))))

def buildGraphics(x,y):
    phase_real = vetor_total_ajustado_np(x.phaseGain, y.phase)
    diff_real = vetor_total_ajustado_np(x.diffGain, y.diff)
    voltage_real = vetor_total_ajustado_np(x.voltageGain, y.voltage)
    leakage_real = vetor_total_ajustado_np(x.leakageGain, y.leakage)

    ciclo = 8  # ciclo escolhido + 512 = 2 ciclos calculados, modificar conforme for....
    print("Valor RMS phase_real:", rms_np(phase_real[ciclo*256:(ciclo*256+512)]), "A")
    print("Valor RMS diff_real:", rms_np(diff_real[ciclo*256:(ciclo*256+512)])*1000, "mA")
    print("Valor RMS voltage_real:", rms_np(voltage_real[ciclo*256:(ciclo*256+512)]), "V")
    print("Valor RMS leakage_real:", rms_np(leakage_real[ciclo*256:(ciclo*256+512)])*1000, "mA")
    
    # caso quiser verificar as capturas dos 4 canais:  deve ter instalado modulo matplotlib
    plt.subplot(411)
    plt.title("DADOS ESCALA REAL")
    plt.plot(phase_real)
    plt.grid()

    plt.subplot(412)
    plt.plot(diff_real)
    plt.grid()

    plt.subplot(413)
    plt.plot(voltage_real)
    plt.grid()

    plt.subplot(414)
    plt.plot(leakage_real)
    plt.grid()

    plt.show()
    return

